import React from 'react';

const UserBooks = ({ userBooks, onRemoveFromList }) => {
  return (
    <div className="user-books-container">
      <h2>My Book List</h2>
      {userBooks.map((book) => (
        <div key={book.id} className="book-card">
          <img src={book.image_url} alt={book.title} />
          <h3>{book.title}</h3>
          <p>{book.author}</p>
          <p>{book.genre.genre}</p>
          <button onClick={() => onRemoveFromList(book.id)}>Remove from My List</button>
        </div>
      ))}
    </div>
  );
};

export default UserBooks;
